import React from 'react';
import { Row, Col } from 'react-bootstrap'

const Footer = () => {
    return (
        <Row>
            <Col>
                <div className="text-center">
                    <h5>Developed by Dongwook Kim <small>dongwook224@naver.com</small></h5>
                </div>
            </Col>
        </Row>
    )
}

export default Footer;
